var telaToda = document.querySelector('.tela-toda')

function apareceTelaToda(imageUse) {
    if (imageUse == 0) {
        telaToda.style.display = 'block'
        telaToda.style.backgroundImage = "url('data:image/jpeg;base64,')"
    }
    if (imageUse == 1) {
        telaToda.style.display = 'block'
        telaToda.style.backgroundImage = "url('../images/cara cabeludo.jpg')"
    }
    if (imageUse == 2) {
        telaToda.style.display = 'block'
        telaToda.style.backgroundImage = "url('data:image/jpeg;base64,')"
    }
    if (imageUse == 3) {
        telaToda.style.display = 'block'
        telaToda.style.backgroundImage = "url('../images/casal gravida cara beijando bariga da muie.jpg')"
    }
    if (imageUse == 4) {
        telaToda.style.display = 'block'
        telaToda.style.backgroundImage = "url('../images/foto manerinha 3d.jpg')"
    }
    if (imageUse == 5) {
        telaToda.style.display = 'block'
        telaToda.style.backgroundImage = "url('../images/mulher com 3 cores.jpg')"
    }
}

function telaTodaSome() {
    telaToda.style.display = 'none'
}